css:
@-moz-document url-prefix("http://en.wikipedia.org/"), domain(wikipedia.org) {

div#content, div#bodyContent h2, div#bodyContent h3, div#bodyContent h4, div#bodyContent h5, table.ambox tbody, table.ambox td { color: #CFCFCF !important; }
ul#filetoc li a, #content div.thumbcaption, code, table.ambox td a, div#mp-tfa, div#mp-itn, div#mp-dyk, div#mp-otd { color: #DFDFDF !important; }
body.mediawiki, div#mw-head-base, div#panel, div#p-logo, div#mw-panel, div#content, table.infobox caption, table.wikitable caption, div#mw-content-text div.NavHead { background: #223241 !important; }

div#simpleSearch, form#searchform { margin-top: 0 !important; width: 18em !important; }
div#simpleSearch { position: absolute !important; top: 8px; right: 5px; background: #EEE !important; }
div#p-namespaces, div#p-views, div#page-base, div#p-personal, div#siteNotice, div#p-cactions, div#protected-icon, div#spoken-icon, div#good-star, div#mw-fr-revisiontag { display: none !important; }
button#searchButton img { margin-bottom: 6px !important; }
div#mw-content-text span#coordinates a { font: 600 10pt segoe ui, sans-serif !important; color: #7998B1 !important; }
div#mw-content-text span#coordinates a span.geo-dec, div#mw-content-text span#coordinates a span.latitude, div#mw-content-text span#coordinates a span.longitude { color: #BBB519 !important; }
div#contentSub a { color: #7998B1 !important; }
div#mw-panel { position: absolute !important; top: 125px !important; padding: 10px 0 0 3px !important; }
div#mw-page-base { width: 160px !important; }
div#p-logo { height: 121px !important; width: 139px !important; top: -125px !important; left: 0 !important; padding-top: 10px !important; padding-left: 21px !important; }
div#mw-panel div.body ul li a, div.portal ul li a, div.portal a:visited { color: #DFDFDF !important; font: 400 10pt consolas, monospace !important; }
li#n-mainpage-description a { font-weight: 600 !important; }
div.portal { margin: 0 6px 5px 6px !important; border: 1px solid #555 !important; background: #496881 !important; }
div.portal h3, div.portal h3 a, div.portal a.wbc-editpage { color: #DFDFDF !important; font: 600 10pt consolas, monospace !important; }
div#content a:visited, div#mw-content-text table.navbox a:visited, div#mw-content-text td.navbox-even a:visited, div#mw-content-text td.navbox-odd a:visited, span.citation a:visited, span.mw-cite-backlink a:visited, span.reference-text a:visited, div.rellink a:visited, div.relarticle a:visited, div.mainarticle a:visited, table.wikitable a:visited { color: #79B8B1 !important; }
div#mw-content-text a, div#mw-content-text h2 a, div#mw-content-text p a, div#mw-content-text ul a { color: #7998B1 !important; }
div#mw-content-text ul, div#mw-content-text li { list-style-image: none !important; }
#toc { border-radius: 5px !important; }
#toc:hover { box-shadow: 0px 0px 5px #DFDFDF; }
#toc, div#catlinks, div#bodyContent table { background: #496881 !important; }
div#mw-content-text #toc ul { list-style-image: none !important; }
#toc a, #toc ul li a, div#bodyContent div#toctitle h2, div#bodyContent table { color: #DFDFDF !important; }
#content div.thumbinner { background: #496881 !important; border: 1px solid #AFAFAF !important; border-radius: 3px !important; }
#content a.image img { background: #EFEFEF !important; border: none !important; }
#content div.thumbcaption { background: #496881 !important; font: 400 8pt segoe ui, sans-serif !important; padding: 4px 0 0 3px !important; }
#content div.thumbcaption a, div#bodyContent table a { color: #DFDFDF !important; font-weight: bold; }
div#bodyContent table th, code { background-color: #223241 !important; }
div#bodyContent table a.new { color: #FF2211 !important; font-weight: 600 !important; }
div#bodyContent img.tex { background: #EEE !important; padding: 2px !important; border-radius: 4px !important; }
table.tracklist tr[style="background-color: #fff;"] { background: #496881 !important; color: #DFDFDF !important; }
table.tracklist tr[style="background-color: #f7f7f7;"] { background: #395871 !important; color: #CFCFCF !important; }
code { border-radius: 3px !important; padding: 0 1px 0 1px !important; }
div.mw-code { background: #EFEFEF !important; }
div#content { position: absolute !important; top: 0; padding: 5px 5px 0 0 !important; border: none !important; font: 400 12pt segoe ui, sans-serif !important; }
h1#firstHeading { margin: 10px 0 3px 0 !important; font: 700 16pt consolas, monospace !important; color: #BFBFBF !important; } 
div#bodyContent h2 { font: 600 12pt segoe ui, sans-serif !important; border-bottom: 1px solid #BBB !important; }
div#bodyContent h3 { font: 600 11pt segoe ui, sans-serif !important; }
div#bodyContent h4 { font: 600 10pt segoe ui, sans-serif !important; }
div#bodyContent h5 { font: 400 10pt segoe ui, sans-serif !important; }
div#mw-content-text h2, div#mw-content-text h3 { clear: left !important; }
div#bodyContent h3 span a, div#bodyContent h4 a, div.rellink a, div.relarticle a, div.mainarticle a { color: #7998B1 !important; }
table.infobox { width: 20% !important; }
table.infobox, table.infobox tr, table.infobox td, table.vertical-navboxtable.ambox, table.navbox, 
table.infobox div[style="width:100%; text-align:center; font-size:105%; font-weight:bold; background: #A8EDEF; line-height:1.5"],
table.infobox div[style="width:100%; text-align:center; line-height:1.5; background: #A8EDEF;"], 
table.infobox div[style="width:100%; text-align:center; line-height:1.4; background: #E6E6FA"] { background: transparent !important; }
table.vertical-navbox, table.multicol, table.navbox, table.ambox { border-radius: 3px !important; }
table.vertical-navbox td[style="padding:0 0.1em 0.4em;"] { padding: 0 !important; }
table.infobox, table.infobox a { color: #DFDFDF !important; font: 400 9pt consolas, monospace !important; }
table.infobox a { font-weight: bold !important; }
table.infobox caption { border-left: 1px solid #CFCFCF !important; border-right: 1px solid #CFCFCF !important; border-top: 1px solid #CFCFCF !important; }
div#mw-content-text table.infobox th { padding-left: 3px !important; background-color: #223241 !important; color: #CFCFCF !important; border-radius: 3px !important; }
div#mw-content-text table.infobox div[style="border-top: 1px solid black"] { border-top: 1px solid #DFDFDF !important; }
table.ambox-globalize, table.ambox-multiple_issues { margin-bottom: 3px !important; background: #CFCFCF !important; }
table.ambox tbody { background: #496881 !important; }
table.ambox td { font: 400 9pt segoe ui, sans-serif !important; }
table.ambox td a { text-decoration: underline !important; }
table.wikitable, table.wikitable caption, table.jquery-tablesorter, table.wikitable th, table.wikitable b { background-color: #496881 !important; color: #DFDFDF !important; font: 400 10pt segoe ui, sans-serif !important; }
table.wikitable a { color: #DFDFDF !important; font: 600 10pt segoe ui, sans-serif !important; }
table.wikitable caption { border: 1px solid #DFDFDF !important; }
table.wikitable th, table.wikitable th b { background-color: #223241 !important; }
table.wikitable tr, table.wikitable td { background: transparent !important; }
div#bodyContent blockquote { width: 66% !important; margin-left: auto !important; margin-right: auto !important; padding-left: 5px !important; padding-right: 5px !important; border: 1px solid #777 !important; border-radius: 3px !important; background: #496881 !important; font: 400 10pt segoe ui, sans-serif !important; color: #DFDFDF !important; }
div#bodyContent blockquote a, div.quotebox a { color: #DFDFDF !important; text-decoration: underline !important; }
div.quotebox { border-radius: 3px !important; background: #496881 !important; font: 400 10pt segoe ui, sans-serif !important; color: #DFDFDF !important; }
table#disambigbox a, div.dablink a { font: 400 10pt segoe ui, sans-serif !important; color: #7998B1 !important; font-style: italic !important; }
table.stub a { color: #7998B1 !important; }
div#mw-content-text td, div#mw-content-text tr { background: transparent !important; }
span[style="color:red"] { color: #B50011 !important; }
div.thumb { background: #496881 !important; }
div.checkcategories div.mw-content-ltr { border: 1px solid #BBB !important; }
div#mw-content-text table.mw-stack tbody tr td { width: 300px !important; }
div#footer { display: none !important; }
table.plainlinks[style="border:1px solid #aaa; background-color:#f9f9f9;"] { border: 1px solid #496881 !important; background: #696969 !important; color: #EEE !important; }
table.plainlinks[style="border:1px solid #aaa; background-color:#f9f9f9;"] a { color: #DFDFDF !important; text-decoration: underline !important; }
th.navbox-title, td.navbox-abovebelow { background: #6988A1 !important; }
td.navbox-even, td.navbox-odd, table.navbox-subgroup { background: transparent !important; }
div#bodyContent th.navbox-group { padding-left: 2px !important; padding-right: 3px !important; border-bottom: 1px solid #999965 !important; background: #496881 !important; }
table.collapsible tr[style="height: 2px;"], table.collapsible tr[style="height:2px;"] { display: none !important; }
table.collapsible tr[style=""] th { border: none !important; }
td.navbox-even, td.navbox-odd { border-left: none !important; border-bottom: 1px solid #A8A87A !important; }
div#mw-content-text td.navbox-even a, div#mw-content-text td.navbox-odd a, th.navbox-title, div#mw-content-text th.navbox-title a, div#mw-content-text td.navbox-abovebelow ul a, div#mw-content-text td.navbox-abovebelow div a, th.navbox-group a, div#mw-content-text div.checkcategories div.mw-content-ltr a { color: #DFDFDF !important; font-weight: bold !important; }
table.navbox-columns-table td[style="padding:0px;text-align:center;background:#efefef;;;text-align:center;background:#fd6;;width:10em;"] { background: #895 !important; }
table.navbox-columns-table td[style="border-left:2px solid #fdfdfd;padding:0px;text-align:center;background:#efefef;;;text-align:center;background:white;;width:10em;"] { background: #387 !important; }
table.navbox-columns-table td[style="border-left:2px solid #fdfdfd;padding:0px;text-align:center;background:#efefef;;;text-align:center;background:silver;;width:10em;"] { background: #999 !important; }
table.navbox-columns-table td[style="border-left:2px solid #fdfdfd;padding:0px;text-align:center;background:#efefef;;;text-align:center;background:#ccf;;width:10em;"] { background: #858 !important; }
table.navbox-columns-table td[style="padding:0px;text-align:center;background:#efefef;;;text-align:center;background:LemonChiffon;;width:10em;"] { background: #895 !important; }
td.navbox-list td[style="background:#FFCCCC;"] { background: #923 !important; }
td.navbox-list td[style="background:#D0E7FF;"] { background: #349 !important; }
td.navbox-list span[style="background-color:gainsboro"] { background: #7998B1 !important; }
span.citation a, span.mw-cite-backlink a, span.reference-text a { color: #7998B1 !important; }
div#mw-normal-catlinks a { color: #DFDFDF !important; font: 700 9pt segoe ui, sans-serif !important; }
table#mp-upper td { border: none !important; }
table#mp-topbanner td[style="width:61%; color:#000;"] { width: 5% !important; }
table#mp-topbanner td[style="width:13%; font-size:95%;"] { width: 6% !important; }
h2#mp-tfa-h2, h2#mp-dyk-h2 { background: #ACD0BE !important; }
h2#mp-itn-h2, h2#mp-otd-h2 { background: #ACBDD0 !important; }
h2#mp-tfa-h2 span.mw-headline, h2#mp-dyk-h2 span.mw-headline, h2#mp-otd-h2 span.mw-headline, h2#mp-itn-h2 span.mw-headline { color: #223241 !important; }

div#p-logo a { height: 135px !important; background: url(data:image/png;base64,) no-repeat !important; }
div#p-lang span.uls-settings-trigger { margin-right: 3px !important; background-image: url(data:image/png;base64,) !important; }
table.sortable th.headerSort { background-image: url(data:image/gif;base64,) !important; background-position: right center !important; background-repeat: no-repeat !important; }
table.sortable th.headerSortDown { background-image: url(data:image/gif;base64,) !important; background-repeat: no-repeat !important; }
table.sortable th.headerSortUp { background-image: url(data:image/gif;base64,) !important; background-repeat: no-repeat !important; }
}
